The code fragment below issues the compile error
"The variable obj1 may be null" on the line marked /***/
----
public static boolean equalAllowingForNulls(Object obj1, Object obj2)
	{
		if (obj1 == null && obj2 == null)  { return true; }
		if (obj1 == null && obj2 != null)  { return false; }
		if (obj1 != null && obj2 == null)  { return false; }
	/***/	return obj1.equals(obj2);
	}

A human reader detects that the first two lines are equivalent to:

if (obj1 == null) {
  return obj2 == null;
}

This would then trigger a "obj1 cannot be null" warning on the third line.

Our current implementation is not capable of detecting that equivalence, and we have no plans to integrate such capability in the shorter term (needs that a multivariate diffusion of values be performed, which other analyzers may do, but at a time/space cost not deemed compatible with JDT targets).

Being that Search is an application modal, only one search dialog should be allowed to be opened at a time.  For example, let's say that I have an action that runs the following code:

NewSearchUI.openSearchDialog(PlatformUI.getWorkbench().getActiveWorkbenchWindow(), null);
NewSearchUI.openSearchDialog(PlatformUI.getWorkbench().getActiveWorkbenchWindow(), null);

The search dialog should only be opened once.  This is especially necessary since there is no centralized location (that I'm aware of) for asking if a search dialog is open.  It also will come in handy when you have an external source, such as the Help windows (which is how I discovered the problem), with an action to open the help dialog.  For example, my help documentation shows how to use search features in my application, and each search help page has a link that opens the search dialog.  Clicking this link twice opens two dialog boxes, both of which are modal.

Also, this comes in handy when something in the background wishes to switch the search page that the user is currently using.  If a search is not opened, search is opened to the correct page.  If search is opened, it should just switch to the right page.

